import React from 'react'

function MaizeMill() {
  return (
    <div>
        <h1>MaizeMill</h1>
        <p>If you want to grind your  maize into floor and make some concake (ugali) or poridge (uji) you can use any maize mill nearer</p>
    </div>
  )
}

export default MaizeMill
